  ,[[[0,"I could not agree with you more. I come from the times when playing was all about hanging out with friends ridding bikes. I'm lucky to have the opportunity to raise my kids in the same manner. However, most neighborhoods now days, are not as safe as they used to be and most kids rather play Xbox than ride their bikes. !0 yrs ago I hosted a Â conference for Cisco Systems. The presenter stated \"in 5 yrs phone lines will not be used in the public sector\" He was right. With this change we learned to text and forgot how to talk. No one calls to say hello and have a conversation. When I was a teen, I spent hours on the phone with my girlfriend. Now kids send texts and get shy in public. For me its already weird..... Â :) Â If you ask me we are already loosing the ability to interact or connect with one another. A text \"I love you\" will never mean the same as having some one hold your hand and loose them selves in your eyes and say it. 80% of our communication is body language and eye contact. If we are looking at the screen, we are missing 80% of whats being presented. Weird.... Its ok, this is just the cost for advancement... Â You know, that thing we call progress.... Progress??? :)\ufeff"]
