  moreShow lessAdd a comment...CNNMoneyShared publicly  -  2015-12-09 Here's what
  you learn what you hang out with #hackers - no two are the same, or #hack for the
  same reason. Some people hack for a cause. One group you might have heard of: Anonymous.
  They take on everyone from law enforcement to ISIS. Another hacktivist, who goes
  by the alias Bob Ross (like the painter), tells us about how he hacked a Nazi forum
  and crippled the group. But it's not so cut-and-dry; to fund his hacktivism, he
  develops software to find security flaws. He sells those flaws to hackers to steal
  your credit cards. The secrets of #hacktivists. http://cnnmon.ie/1IEA4mXï»¿Read
