  publicly  -  2015-12-08 There are good hackers and bad #hackers. Shyama Rose is
  on the good side. Just like the fictional Lisbeth Salander, Rose faced abuse and
  fought back with an incredible ability to hack. Rose grew up in a cult, where she
  was abused by the leader. Her lifesaver: a computer. For years, she taught herself
  to code and hack. It became her ticket to freedom, helping her break away from the
  oppressive religious community. http://cnnmon.ie/1ICQ5K1ï»¿Read moreShow lessCNNMoney's
